function Home() {
    return (
        <div className="loginPage">
            <h1>Home Page of Schedule Master!</h1>
            
            <div className="loginCard"> 
                <a href="/login">
                    <button>Go To login page</button>
                </a>
            </div>
        </div>
    )
}

export default Home;
